import React, {useEffect} from 'react'
import axios from 'axios'
const App = () => {
  useEffect(() => {
    const fetchData = async () => {
      try {
        const result = await axios.get(`http://localhost:3001/`)
        console.log(result)
      } catch (err) {
        console.log(err)
      }
    }
    fetchData()
  }, [])
  return <div>App</div>
}

export default App
